Currently, it\&amp;#039;s at the alpha testing stage, and primaraly here for developers to test, although other users can test it.  As the installer is designed to work in a low risk way, the chances of the system being damaged by the installer are very low, but the chances that it won\&amp;#039;t work are quite high (since it\&amp;#039;s alpha).  An uninstaller is included, so you can always uninstall it and have your system back to how it was before)

Understand that this is unofficial test software, no guarantees are made about this!

You must have 7.5GB of free disk space to install.
